import React, { Component } from "react";
import { connect } from "react-redux";
import {
  Button,
  Container,
  Form,
  Row,
  Col,
  FormGroup,
  Nav,
  NavItem
} from "react-bootstrap";
import "../../css/grubhub.css";

class OwnerSignUp extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isVisible: true
    };
  }

  render() {
    return (
      <div>
        <Row>
          <div class="col-sm-3">
            <div class="sidebar-nav">
              <div class="navbar navbar-default" role="navigation"></div>
            </div>
          </div>
        </Row>
      </div>
    );
  }
}
function mapStoreToProps(state) {
  return state;
}
export default connect(mapStoreToProps)(OwnerSignUp);
